import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  & > .back {
    width: 100%;
    height: 621px;
    background-color: #47d99b;
    border-bottom-left-radius: 200px;
    position: absolute;
    top: 0;
    left: 0;
    z-index: -1;
  }
`;

function Section1() {
  return (
    <Wrapper>
      <article className="top">
        <div className="back" />
        <div></div>
      </article>
    </Wrapper>
  );
}

export default Section1;
